import React from "react";
import { GoogleApiWrapper, Map, Circle } from "google-maps-react";

class MapContainer extends React.Component {
  state = { center: { lat: 37.85, lng: -122.541 }, circles: [] };

  clickCircle = (props, circle) => {
    console.log(props.placeId);
  };

  componentDidMount() {
    var myHeaders = new Headers();
    myHeaders.append(
      "Authorization",
      "Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..NYtowwCyR2maLnImby9a6nVVF3ViXpYUb1-dZVr6-J4"
    );

    var requestOptions = {
      method: 'GET',
      headers: myHeaders,
      redirect: 'follow'
    };

    fetch("https://api.iq.inrix.com/lots/v3?point=37.74638779388551%7C-122.42209196090698&radius=1000", requestOptions)
      .then(response => response.json())
      .then(data => {
        const parsedCircles = data.result.map(item => ({
            place_id: item.id,
            position: {
              lat: item.peps[0].pepPt[1],
              lng: item.peps[0].pepPt[0],
          },
          radius: 50, // Set your desired radius in meters
        }));

        this.setState({ circles: parsedCircles });
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }

  render() {
    const { google } = this.props;

    return (
      <Map
        google={google}
        center={this.state.center}
        style={{ height: "100%", position: "relative", width: "100%" }}
        zoom={8}
      >
        {this.state.circles.map(circle => (
          <Circle
            key={circle.place_id}
            center={circle.center}
            radius={circle.radius}
            onClick={() => this.clickCircle({ placeId: circle.place_id })}
            options={{
              strokeColor: "#00FF00", // Green outline
              strokeOpacity: 0.8,
              strokeWeight: 2,
              fillColor: "#00FF00", // Green fill color
              fillOpacity: 0.35,
            }}
          />
        ))}
      </Map>
    );
  }
}

export default GoogleApiWrapper({
  apiKey: "AIzaSyDrcb7m1SF9y8PMHuiC1JzRg2emyaRZJTg"
})(MapContainer);
